@xadupre probably knows best.

> There is a test for ORT's current behaviour showing that it produces 6 outputs for a 4 class problem (i.e. 4*3/2) and 2 outputs for a 2 class problem (which is not 2*1/2).

Not sure where your `num_classes * (num_classes - 1) / 2` formula comes from as I don't see it in the spec. 
I believe there are 6 outputs as the first 2 classes have 2 vectors (specified in vectors_per_class).

```
  std::vector<int64_t> classes = {0, 1, 2, 3};
  std::vector<int64_t> vectors_per_class = {2, 2, 1, 1};
 ```
